import React from "react";
import logo from "../assets/Logo WO Branding-02 1.png";
function Header() {
  return (
    <div>
      <div className="" style={{display:'flex', flexDirection:'column'}}>
        <img src={logo} alt="logo" />
        <h3>Webure</h3>
      </div>
    </div>
  );
}

export default Header;
